import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import 'antd/dist/antd.min.css';
import './App.css';
const { Header, Content, Footer } = Layout;

export default class App extends Component {
    render() {
        return (
            <Layout className="layout" style={{minHeight: '100vh', padding: '0, 100px, 0, 100px'}}>
                <Header style={{display: 'flex'}}>
                    <div className="logo" style={{color: 'white'}}>
                        <span className="fa fa-music"></span>&nbsp;
                        718音乐
                    </div>
                    <Menu theme="dark" mode="horizontal" defaultSelectedKeys={"recommend"} style={{marginLeft: 20}}>
                        <Menu.Item key="recommend">推荐</Menu.Item>
                        <Menu.Item key="artist">歌手</Menu.Item>
                    </Menu>
                </Header>
                <Content style={{ padding: '0 50px' }}>
                    <Breadcrumb style={{ margin: '16px 0' }}>
                        <Breadcrumb.Item>Home</Breadcrumb.Item>
                        <Breadcrumb.Item>List</Breadcrumb.Item>
                        <Breadcrumb.Item>App</Breadcrumb.Item>
                    </Breadcrumb>
                    <div className="site-layout-content">Content</div>
                </Content>
                <Footer style={{ textAlign: 'center' }}>718音乐 ©2021 Created by YWJ</Footer>
            </Layout>
        );
    }
}
